import React from 'react';
import './clock.css';
import './clock.png';

const clock = () => {
        return(
            <div class='clock'>
                <div class='hour'>
                    <div class='hr' id='hr'></div>
                </div>
                <div class='min'>
                    <div class='mn' id='mn'></div>
                </div>
                <div class='sec'>
                    <div class='sc' id='sc'></div>
                </div>
            </div>
        )
}
export default clock;
